import { Link } from "react-router-dom";
import React from 'react';

function Header (props){
    return (
        <div id='HeaderContainer'>
            <ul id = 'Header' >
                <li className ='headerList'><Link to ='/Transaction'>Transaction</Link></li>
                <li className ='headerList'><Link to ='/Portfolio'>Portfolio</Link></li>
            </ul>
        </div>
    );
}

export default Header;
